const getPrice = (source, destination) => {
  return new Promise((resolve) => {
    jQuery.ajax({
      url : 'https://websites.platform.taximaster.ru/v2/calc_order_cost',
      type: 'POST',
      dataType : "json",
      crossDomain: true,
      "headers": {
        "Access-Control-Allow-Origin":"*",
        Accept: 'application/json, text/javascript, */*; q=0.01',
        'Accept-Encoding': 'gzip, deflate, br',
        'Accept-Language': 'ru,en;q=0.9',
        Connection: 'keep-alive',
        'Content-Length': 655,
        'Content-Type': 'application/x-www-form-urlencoded; charset=UTF-8',
        Host: 'websites.platform.taximaster.ru',
        Origin: 'https://websites.platform.taximaster.ru',
        Referer: 'https://websites.platform.taximaster.ru/widget?cid=56',
        'Sec-Fetch-Mode': 'cors',
        'Sec-Fetch-Site': 'same-origin',
        'User-Agent': 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_15_2) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/78.0.3904.97 YaBrowser/19.12.0.769 Yowser/2.5 Safari/537.36',
        'X-Requested-With': 'XMLHttpRequest',
        'X-Site-VtmGroupId': 56,
        'X-Site-VtmId': 134
      },
      data: {
        source_lat: source.lat,
        source_lon: source.lon,
        destination_lat: destination.lat,
        destination_lon: destination.lon,
        source_time_iso8601: '2020-08-28T17:01:07+03:00',
      },
      success: function (response) {
        resolve(parseFloat(response));
      },
      error: function (xhr, status) {
        console.log("error");
      }
    });
  });
};


